#[kn-widget-id] .cardContainer {
  height: 100%;
  background-image: url('data:image/jpeg;base64,');
  background-size: cover;
  background-repeat: no-repeat;
  position: relative;
  font-family: 'Squada One';
  color: #062e6c;
}

#[kn-widget-id] .cardContainer .cardImage {
  height: 100%;
  position: absolute;
  width: 30%;
  background: rgba(209,201,228,.8);
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

#[kn-widget-id] .cardImage img {
  height: 85px;
  width: 80px;
  left: 30%;
  top: 13%;
  position: relative;
}

#[kn-widget-id] .cardContainer .cardTitle {
  position: absolute;
  top: 10px;
  right: 0;
  padding: 8px 8px 8px 40px;
  background-color: rgba(255,255,255,.8);
  text-transform: uppercase;
  font-size: 25px;
  text-align: right;
}

#[kn-widget-id] .cardContainer .cardValue {
  position: absolute;
  top: 58px;
  right: 0;
  padding: 4px 8px 4px 80px;
  background-color: rgba(255,255,255,.8);
  text-transform: uppercase;
  font-size: 34px;
  font-weight: bold;
  text-align: right;
}
